import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroImage from "../images/hero-bg.jpg";

const PartnershipSearch = () => {
  const navigate = useNavigate();
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    partnershipGoal: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSearchParams((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen relative">
      {/* 背景图片 */}
      <div className="absolute inset-0 z-0">
        <img
          src={heroImage}
          alt="Background"
          className="w-full h-full object-cover"
          style={{
            filter: "brightness(0.7) saturate(0.8) opacity(0.9)",
          }}
        />
        <div
          className="absolute inset-0"
          style={{
            backgroundColor: "rgba(72, 202, 228, 0.1)",
            mixBlendMode: "overlay",
          }}
        />
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 z-10 text-white hover:text-gray-200 transition-colors"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 min-h-screen flex flex-col items-center justify-center px-4">
        <div className="text-center mb-12">
          <h1 className="text-5xl font-bold text-white mb-4 tracking-tight">
            Let's Find Your Perfect Partner
          </h1>
          <p className="text-xl text-gray-200">
            Discover organizations that align with your mission and values
          </p>
        </div>

        <div className="w-full max-w-3xl bg-white/95 backdrop-blur-md rounded-2xl shadow-2xl p-8">
          <div className="grid gap-6">
            <div className="grid grid-cols-2 gap-6">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  Location
                </label>
                <input
                  type="text"
                  name="location"
                  value={searchParams.location}
                  onChange={handleChange}
                  placeholder="Enter city or region"
                  className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  Organization Type
                </label>
                <select
                  name="orgType"
                  value={searchParams.orgType}
                  onChange={handleChange}
                  className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all"
                >
                  <option value="">Select type</option>
                  <option value="nonprofit">Nonprofit</option>
                  <option value="forprofit">For-profit</option>
                  <option value="social">Social Enterprise</option>
                  <option value="government">Government</option>
                </select>
              </div>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                What Kind of Organization Are You Looking For?
              </label>
              <textarea
                name="partnershipGoal"
                value={searchParams.partnershipGoal}
                onChange={handleChange}
                placeholder="Describe your ideal partnership..."
                rows="4"
                className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all resize-none"
              />
            </div>

            <button className="w-full bg-gradient-to-r from-cyan-500 to-blue-500 text-white py-4 rounded-lg font-medium hover:from-cyan-600 hover:to-blue-600 transition-all shadow-lg">
              Search Partners
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PartnershipSearch;
